import React, { useState } from 'react';

import './Profile.css';

const Profile = () => {
    const [menuOpen, setMenuOpen] = useState(false);
    const [selectedMenu, setSelectedMenu] = useState('');
    const [formData, setFormData] = useState({
        firstName: '',
        lastName: '',
        mobile: '',
        dob: '',
        email: ''
    });
    const [message, setMessage] = useState('');
    const history = useHistory();

    const toggleMenu = () => {
        setMenuOpen(!menuOpen);
    };

    const handleMenuClick = (menu) => {
        setSelectedMenu(menu);
    };

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value
        });
    };

    const handleSubmit = () => {
        setMessage('Details Submitted Successfully');
        setTimeout(() => {
            history.push('/profile/my-programs'); // Redirect to My Programs page
        }, 2000);
    };

    const handleClose = () => {
        history.push('/'); // Redirect to Home page
    };
    const navigate = useNavigate();
    navigate('/some-route');
    
    return (
        <div className="profile-page">
            <div className={`sidebar ${menuOpen ? 'open' : ''}`}>
                <button className="toggle-btn" onClick={toggleMenu}>
                    {menuOpen ? '←' : '→'}
                </button>
                <ul>
                    <li onClick={() => handleMenuClick('Your Profile')}>Your Profile</li>
                    <li onClick={() => handleMenuClick('My Programs')}>My Programs</li>
                    <li onClick={() => handleMenuClick('My Diet Plans')}>My Diet Plans</li>
                    <li onClick={() => handleMenuClick('My Articles')}>My Articles</li>
                    <li onClick={() => handleMenuClick('My Medical History')}>My Medical History</li>
                    <li onClick={() => handleMenuClick('My Progress')}>My Progress</li>
                    <li onClick={() => handleMenuClick('My Trainer')}>My Trainer</li>
                    <li onClick={() => handleMenuClick('My Subscription')}>My Subscription</li>
                </ul>
            </div>

            <div className={`profile-content ${selectedMenu === 'Your Profile' ? 'show-profile-form' : ''}`}>
                <div className="profile-header">
                    <div className="profile-pic">
                        <img src="/p.jpg.jpg" alt="Profile Pic" />
                    </div>
                    <h2>Shreya Sharma</h2>
                </div>

                {selectedMenu === 'Your Profile' && (
                    <div className="form-container">
                        <h3>Edit Your Profile</h3>
                        {message && <p style={{ color: 'lime', textAlign: 'center' }}>{message}</p>}
                        <input
                            type="text"
                            name="firstName"
                            placeholder="First Name"
                            value={formData.firstName}
                            onChange={handleChange}
                        />
                        <input
                            type="text"
                            name="lastName"
                            placeholder="Last Name"
                            value={formData.lastName}
                            onChange={handleChange}
                        />
                        <input
                            type="number"
                            name="mobile"
                            placeholder="Mobile Number"
                            value={formData.mobile}
                            onChange={handleChange}
                        />
                        <input
                            type="date"
                            name="dob"
                            value={formData.dob}
                            onChange={handleChange}
                        />
                        <input
                            type="email"
                            name="email"
                            placeholder="Email Address"
                            value={formData.email}
                            onChange={handleChange}
                        />

                        <button className="close-btn" onClick={handleClose}>Close</button>
                        <button className="submit-btn" onClick={handleSubmit}>Submit</button>
                    </div>
                )}
            </div>
        </div>
    );
};

export default Profile;
